import React from 'react';
import logo from '../../images/logo.png';

const Logo = (props) => {
    return <img onDrag={ () => { return false }} src={logo} alt='logo' className={props.className} style={{width: props.width + 'px', pointerEvents: 'none'}}/>
}

export default Logo
